CREATE DATABASE IF NOT EXISTS library;

USE library;

DROP TABLE IF EXISTS activity;

CREATE TABLE `activity` (
  `s_id` int(11) NOT NULL,
  `book_no` varchar(50) NOT NULL,
  `due_date` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `return_date` varchar(100) NOT NULL,
  `fine` int(11) NOT NULL,
  `l_id` int(11) NOT NULL,
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `outsider` int(11) DEFAULT '0',
  `current_class` varchar(10) DEFAULT NULL,
  `checked` tinyint(4) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS admin;

CREATE TABLE `admin` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pwd` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS book_cat;

CREATE TABLE `book_cat` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS books;

CREATE TABLE `books` (
  `book_no` varchar(50) NOT NULL,
  `book_title` varchar(50) NOT NULL,
  `book_cat` varchar(50) NOT NULL,
  `book_author` varchar(30) DEFAULT NULL,
  `publisher` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`book_no`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS librarians;

CREATE TABLE `librarians` (
  `l_id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(30) NOT NULL,
  `pwd` varchar(30) NOT NULL,
  `assign` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`l_id`),
  UNIQUE KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS prof_out;

CREATE TABLE `prof_out` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pro_id` varchar(15) DEFAULT NULL,
  `name` varchar(50) NOT NULL,
  `title` varchar(30) DEFAULT NULL,
  `regist_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `pass` varchar(30) DEFAULT NULL,
  `activate` int(2) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS students;

CREATE TABLE `students` (
  `s_id` int(11) NOT NULL AUTO_INCREMENT,
  `s_name` varchar(50) NOT NULL,
  `class` char(5) NOT NULL,
  `section` char(5) NOT NULL,
  `save_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `pass` varchar(30) DEFAULT NULL,
  `activate` tinyint(1) DEFAULT NULL,
  `still` int(2) DEFAULT NULL,
  PRIMARY KEY (`s_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1005 DEFAULT CHARSET=latin1;




